from datetime import datetime
from typing import List, Dict, Any, Optional

class Submission:
    def __init__(self, user_id: str, submission_id: str, status: str, created_at: datetime):
        self.user_id = user_id
        self.submission_id = submission_id
        self.status = status
        self.created_at = created_at
        self.updated_at = created_at

    def update_status(self, new_status: str):
        self.status = new_status
        self.updated_at = datetime.now()

class User:
    def __init__(self, user_id: str, user_role: str):
        self.user_id = user_id
        self.user_role = user_role
        self.submissions: List[Submission] = []

    def submit_data(self, submission_id: str, status: str):
        submission = Submission(self.user_id, submission_id, status, datetime.now())
        self.submissions.append(submission)

    def get_submission_history(self) -> List[Dict[str, Any]]:
        return [{"submission_id": s.submission_id, "status": s.status, "created_at": s.created_at} for s in self.submissions]

class FABSUser(User):
    def download_file(self, submission_id: str) -> str:
        # Logic to download the file based on submission_id
        return f"File for submission {submission_id} downloaded."

    def validate_submission(self, submission_id: str) -> str:
        # Validation logic
        for submission in self.submissions:
            if submission.submission_id == submission_id:
                if submission.status == "pending":
                    submission.update_status("validated")
                    return "Validation successful."
                else:
                    return "Submission already processed."
        return "Submission not found."

class AgencyUser(User):
    def submit_data_with_flexfields(self, submission_id: str, flexfields: Dict[str, Any]):
        # Submit data including flexfields
        self.submit_data(submission_id, "submitted_with_flexfields")

    def check_submission_period(self) -> Dict[str, str]:
        # Logic to check the submission period
        return {"start": "2023-01-01", "end": "2023-01-31"}

class Developer:
    def __init__(self):
        self.logs: List[str] = []

    def log_issue(self, message: str):
